import React from 'react';
import stories from './storiesDB';

function ViewStory() {
    const handleViewStory = () => {
        stories.forEach( object => {
            <p>object.body</p>
        })
    }


  return (
    <div>
        <br/>
        <button onClick = {handleViewStory}>View the Story!</button>
    </div>
  );
}

export default ViewStory;
